import React, { Component } from "react";
import LoginForm from "../LoginForm/LoginForm";
import { BrowserRouter, NavLink, Route, Switch } from "react-router-dom";

export class UserLogin extends Component {
  render() {
    return (
      <div>
        <h1>This is Login Page</h1>
        {/* <LoginForm /> */}
        <ul>
          <li>
            <NavLink activeClassName="active" to="/user-login/login/buyer">
              Login As Buyer
            </NavLink>
          </li>
          <li>
            <NavLink activeClassName="active" to="/user-login/login/seller">
              Login As Seller
            </NavLink>
          </li>
          <li>
            <NavLink activeClassName="active" to="/user-login/login/admin">
              Login As Admin
            </NavLink>
          </li>
        </ul>
          <Switch>
            <Route exact path="/user-login/login/buyer" component={LoginForm} />
            <Route
              exact
              path="/user-login/login/seller"
              component={LoginForm}
            />
            <Route exact path="/user-login/login/admin" component={LoginForm} />
          </Switch>
      </div>
    );
  }
}

export default UserLogin;
